A boy lives with his grandmother who&amp;#039;s obssessed with witches. She tells him of the evils of witches and all the signs to detect them and what to do if he ever sees one, etc. Granny is sickly so they go to a seaside resort where she&amp;#039;s supposed to recover her health. While exploring the hotel&amp;#039;s conference room, the kid learns that there&amp;#039;s a big convention in town, but not just any convention, a witch convention. All the witches of the world have assembled in the conference room to discuss their evil plot to rid the world of children by turning them all into mice (they hate kids because to witches they stink). Seconds after the kid overhears their plans, he&amp;#039;s captured by the witches and transformed into a mouse, but luckily he escapes before they can squash him and warns his granny. The kid and his granny take matters into their own hands and use the witches&amp;#039; plot against them. 
